    <Wrapper>
      <div
        className='card_box'
        style={{ backgroundImage: `url(${background})` }}
      >
        <div className='flex_top_card'>
          <span>-40%</span>
          <div>
            <img src={heart_card} />
          </div>
        </div>
        <div className='eye_card'>
          <img src={eye} />
        </div>
      </div>
    </Wrapper>
  );
};

export default Card;
